import React from 'react';
import {Link} from 'react-router-dom';
function Navbar(){
  return (
    <div>
      
       
        <div class="links">
          <Link to='/'>Home</Link>
          <Link to='/kontakt'>Kontakt</Link>
          <Link to='/oferta'>Oferta</Link>
         
        </div>
        <div class="links-mobile"></div>
      
    </div>
  );
};
  
export default Navbar;
